import React from "react";

const Counter = () => {
  const [number, setNumber] = useState(0);

  return (
    <div>
      Your score is: {number}{" "}
      <span onClick={() => plus(setNumber(number++))}>+</span>
      <span onClick={() => plus(number > 0 ? setNumber(number--) : 0)}>-</span>
    </div>
  );
};

export default Counter;
